(3, 'Swim Challenge 2020, Spring', 'We invite all our members to participate to the event which takes 4 weeks with the aim of gaining regular exercise habit. During those 4 weeks who swim at least 3 times more than 45 minute will receive t-shirt and price with lottery. Women Date: March 31, Thursday – May 3, Sunday, Place: Swimming Pool. Men Date: March 31, Thursday – April 26 , Sunday Place: Swimming Pool.', 'pools.jpg', '2005/01/01', '2028/08/01', '1', '');
