(4, 'Fit Challenge 2020, Spring', 'Date:March 30 , Monday-  April 26, Sunday Place: Dormitories Sports Hall A 4-week work-out program which involves cardiovascular endurance and muscle strengthening exercises. If you wish to improve your heart and lung capacity, metabolic rate, muscle and bone density and moreover to direct the daily stresses positively while having fun, then you are welcome to join this challenging special event.', 'fit.jpg', '2005/01/01', '2028/08/01', '1', ''),
(5, 'Strong By Zumba 2020, Spring', 'Date: March 12, Thursday Time: 18:30 p.m. Place : Main Sports Hall The high-intensity “STRONG by Zumba” workout incorporates strength and interval training, using music as the motivator. And, yes, it also keeps the special lighting and party atmosphere that make Zumba stand out from other exercise programs.', 'strongbyzumba.jpg', '2005/01/01', '2028/08/01', '1', '');
INSERT INTO `events` (`id`, `title`, `text`, `photoname`, `startdate`, `enddate`, `display`, `base64`) VALUES
(6, 'Zumba Master Class 2020, Spring', 'Date: March 3, Tuesday Time: 18:30 p.m.  Place : Main Sports Hall', 'zumba.jpg', '2005/01/01', '2028/08/01', '1', '');
INSERT INTO `events` (`id`, `title`, `text`, `photoname`, `startdate`, `enddate`, `display`, `base64`) VALUES
(7, 'Spring Run 2020, Spring', 'Date: Saturday, May 16, 2020 Time: 11:00 a.m. Distance: 2 k. (Walk & Run) Free of Charge Registration Deadline: Friday, May 15, 2020 All students, academic and administrative staff and their family members are welcome to participate in this special event. It is recommended that you train and get ready ahead of time. Trophies will be presented to the first three finishers in each category. Categories are according to age as follows: 11-15, 16-20, 21-25, 26-30, 31-35, 36-44, 45-54, 55-59, 60 and over.', 'springrun.jpg', '2005/01/01', '2028/08/01', '1', '');
INSERT INTO `events` (`id`, `title`, `text`, `photoname`, `startdate`, `enddate`, `display`, `base64`) VALUES
(8, 'aaaa', 'aaa', 'building.jpg', '2005/01/01', '2028/08/01', '1', '');

